A solução proposta consiste na contratação de empresa especializada para ministrar curso teórico de formação de membros da Comissão Interna de Prevenção de Acidentes (CIPA), em atendimento ao disposto na Norma Regulamentadora nº 05 (NR-05), para empresa classificada como de risco 1.

O curso será realizado na modalidade in company, diretamente na sede do CRP/05, visando à capacitação de 04 (quatro) funcionárias(os) designadas(os) como integrantes da CIPA, possibilitando que adquiram os conhecimentos técnicos e legais necessários ao desempenho de suas atribuições.

A capacitação contemplará o conteúdo programático obrigatório estabelecido pela NR-05, incluindo temas como:

Noções sobre legislação trabalhista e de segurança do trabalho;
Prevenção de acidentes e doenças ocupacionais;
Identificação e avaliação de riscos no ambiente de trabalho;
Princípios gerais de primeiros socorros;
Organização e funcionamento da CIPA.
O treinamento será ministrado por profissionais qualificados e ao final deverá ser emitido certificado individual de conclusão para cada participante, assegurando a comprovação da capacitação.

Trata-se de uma solução obrigatória, única e indivisível, cujo atendimento garante a conformidade legal da instituição, fortalece a cultura de prevenção de acidentes e doenças relacionadas ao trabalho e contribui para a preservação da saúde e integridade das(os) funcionárias(os).

